const common = require('./common.js');
const {encd} = require("../w.js")

const bench = common.createBenchmark(main, {
  len: [1,2,4,8],
  n: [1000000],
});

function main({ n, len }) {
  const typedArray = new BigUint64Array(len);
  bench.start();
  for (let i = 0; i < n; i++) encd({ a: 1, b: typedArray });
  bench.end(n);
}



